 Robin Dreeke, &quot;It's Not All About Me: The Top Ten Techniques for Building Quick Rapport with Anyone&quot;
2012 | ISBN: 057809665X | 102 pages | EPUB | 3 MB

Despite the age-old saying, individuals everywhere still have a hard time realizing that it's not all about them. Robin Dreeke uses his research and years of work in the field of interpersonal relations and behavior to help readers focus on building relationships with others in &quot;It's Not All About Me: The Top Ten Techniques for Building Quick Rapport with Anyone&quot;. As the head of the FBI's Behavioral Analysis Program within the Counterintelligence Division, Dreeke has used the techniques listed in &quot;It's Not All About Me&quot; with skilled professionals within the FBI as well as with sales professionals, educators and individuals across the country and world. He knows the information provided will apply to business professionals of all sectors, those just entering the workforce and those leading companies.
